snippet.description:
*Spoilers ahead for HEARTLAND season 14 episode 1* 

@Amber Marshall chatted with Brief Take's Leora Heilbronn about that huge shocking death in the season 14 opener of @Heartland, saying goodbye to Graham Wardle, her favourite Ty & Amy scenes, upcoming Harley and Spartan scenes, being directed by Michelle Morgan (Lou) in episode 9, and much more!


#Heartland #AmberMarshall #ILoveHeartland

